import Header from '../../components/Header/Header';
import { Link, Outlet } from 'react-router-dom';

import './Dashboard.scss';

const Dashboard = () => {
    return (
        <div className="dashboard-main">
            <Header />
            {/* <Outlet /> */}
            <h3>
                <Link to='/movies/1'>Browse Movies</Link>
            </h3>
        </div>
    )
}

export default Dashboard;
